import React from 'react';
import { Typography, Button, ButtonGroup, Container, TextField , Radio, RadioGroup, FormControlLabel} from '@mui/material';
import AcUnitOutlinedIcon from '@mui/icons-material/AcUnitOutlined';
import SendIcon from '@mui/icons-material/Send';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';


const useStyles = styled(TextField)({

    marginTop: 20,
    marginButtom: 20,
    display: 'block',
    color: 'error'

});

export default function Create() {
  return (
    <Container>
      <Typography 
        variant='h4'
        gutterBottom
      > Create a New Node: </Typography> 

      <form noValidate autoComplete="off">

      <TextField 
      classes = {useStyles.TextField}
      label="Note Title" variant="outlined" color = "error" fullWidth required/>
      <br /> <br />

     <TextField 
      classes = {useStyles.TextField}
      label="Deatails" variant="outlined" color = "error" fullWidth required/>

      <br /> <br />


      {/* // אין קשר בין הריואים */}
      <Radio value='hello'/>
      <Radio value='Good By'/>

      {/* // יש קשר ביניהם */}
      <RadioGroup>
        <FormControlLabel value="money" control={<Radio/>} label = "Money" />
        <FormControlLabel value="todos" control={<Radio/>} label = "Todos" />
        <FormControlLabel value="reminders" control={<Radio/>} label = "Reminders" />
        <FormControlLabel value="work" control={<Radio/>} label = "Work" />

      </RadioGroup>

      <Button 
      type='Submit' 
      color='secondary' 
      variant='contained'
      endIcon = {<KeyboardArrowRightIcon/>}
      >SUMBIT</Button>

      </form>
    </Container>
  );
}
